import React from "react"

const Option = (props)=>{

    return(
        <div className="option">
            <div className="green">
                <span>Green</span>
            </div>
            <div className="black">
                   <span>Black</span>
            </div>
            <div className="pink">  
                <span>Pink</span>
            </div>
        </div>
    );

}

export default (Option);
